(function($) {

  //global ajax vars
  var firstload = 1;
  var body = document.body;

  //keep global scripts here or scripts that doesn't need to get reloaded
  const mousePointer = function(pointerEl){
      // ######################################## JS POINTER
      var mouseX = 0,
          mouseY = 0;

      body.addEventListener('mousemove', function(e){
        //console.log(e);
        mouseX = e.clientX;
        mouseY = e.clientY;
        if(mouseX < 0){
          mouseX = 0;
        }
        if(mouseY < 0){
          mouseY = 0;
        }
        pointer.setAttribute('style','left:'+ mouseX +'px; top:'+ mouseY +'px;');
      });
  };
  var pointer = document.querySelector('.module--pointer');
  mousePointer(pointer);

  var hovers = function(hoverItemel,className){
    if(className === undefined){
      hoverItemel.forEach(function(el,id){
        el.addEventListener('mouseover',function(){
          if( body.classList.contains('is--hover__link') ){
            body.classList.remove('is--hover__link');
          }else{
            body.classList.add('is--hover__link');
          }
        });
        el.addEventListener('mouseout',function(){
          body.classList.remove('is--hover__link');
        });
      });
    }else{
      hoverItemel.forEach(function(el,id){
        el.addEventListener('mouseover',function(){
          if( body.classList.contains(className) ){
            body.classList.remove(className);
          }else{
            body.classList.add(className);
          }
        });
        el.addEventListener('mouseout',function(){
          body.classList.remove(className);
        });

        el.parentElement.querySelector('.flickity-viewport').addEventListener('mouseover',function(){
          if( body.classList.contains(className) ){
            body.classList.remove(className);
          }
        });

      });
    }
  };
  var links = document.querySelectorAll('a');
  var buttons = document.querySelectorAll('button');
  hovers(links);
  hovers(buttons);

  //main scrollbar fx
  var Scrollbar = window.Scrollbar;
  var scrollbar = Scrollbar.init(document.querySelector('#main--scrollbar'));
  var lastPosition = 0;
  var lastKnownPosition = 0;

  scrollbar.addListener(function (status) {
    lastPosition = status.offset.y;
    var newScrollPosition = status.offset.y;
    var direction;

    if (newScrollPosition < lastKnownPosition){
      direction = 'up';
    }else{
      direction = 'down';
    }

    lastKnownPosition = newScrollPosition;
  });


  var backTop = function(button,topNode){
  	button.addEventListener('click',function(){
			scrollbar.scrollIntoView(topNode);
  	});	
  }
  var backToTop = document.querySelector('.js--back_top');
  var topNode = document.querySelector('#ajax--content');
  backTop(backToTop,topNode);

  var masonry = function(elMason){
    if( elMason ){
      var msnry = new Masonry( elMason, {
        isInitLayout: false,
        percentPosition: true,
        columnWidth: '.grid-sizer',
        itemSelector: '.grid-item',
        gutter: 100,
      });

      msnry.on( 'layoutComplete', function(){
        var gridItems = elMason.querySelectorAll('.grid-item');
        gridItems.forEach(function(el,id){
          if( el.getBoundingClientRect().top <= window.innerHeight &&  el.getBoundingClientRect().top >= 0 ){
            el.classList.add('is--loaded');
            //run lazyload
          }
        });
        
        scrollbar.addListener(function (status) {
          gridItems.forEach(function(el,id){
            if( el.getBoundingClientRect().top <= window.innerHeight &&  el.getBoundingClientRect().top >= 0 ){
              el.classList.add('is--loaded');
              //run lazyload
            }
          });
        });
      });

      msnry.layout();
    }
  };
  var elMason = document.querySelector('.grid');
  masonry(elMason);

  var sliders = function(elArrSlider){

  		var moduleModal = document.querySelector('.module--mobile_modal');
  		var moduleModalContent = moduleModal.querySelector('.module--mobile_modal--content');
  		var moduleModalClose = moduleModal.querySelector('button');


  		moduleModalClose.addEventListener('click',function(){
  			moduleModalContent.innerHTML = '';
  			body.classList.remove('enable--mobile_modal');
  		})

      if( elArrSlider.length > 0 ){
        elArrSlider.forEach(function(el,id){
          var sliderContainer = elArrSlider[id].querySelector('.container');
          var sliderContent = elArrSlider[id].querySelector('.module--slider_content');
          var flkty = new Flickity( sliderContainer, {
            // options
            lazyLoad: true,
            pageDots: false,
            on: {
              ready: function(){
                var nextButton = el.querySelectorAll('.next');
                var prevButton = el.querySelectorAll('.previous');

                hovers(nextButton,'is--hover__next');
                hovers(prevButton,'is--hover__prev');
              }
            }
          });


          var sliderNodes = el.parentNode.childNodes;
          sliderNodes.forEach(function(el,id){
          	if( el.nodeType == 1 && el.classList.contains('module--slider_meta') ){
          		var buttonLearnMore = el.querySelector('button');
          		buttonLearnMore.addEventListener('click',function(){
          			sliderContainer.parentNode.classList.toggle('enable-content');
          			if( body.classList.contains('enable--mobile_modal') ){
          				moduleModalContent.innerHTML = '';
          				body.classList.remove('enable--mobile_modal');
          			}else{
          				moduleModalContent.innerHTML = sliderContent.innerHTML;
          				body.classList.add('enable--mobile_modal');
          			}
          		});
          	}
          });

        });

      }
  };
  var elArrSlider = document.querySelectorAll('.module--slider');
  sliders(elArrSlider);

  var introAnim = function(){
    document.querySelector('body').classList.remove('is--outro');
  };

  var ajaxRequest = function(url){
    var request = new XMLHttpRequest();
    request.open('GET',url, true);

    request.onload = function(){
      if (request.readyState === 4 && request.status === 200 && request.status !== 400) {
        //console.log('success');
        const data = request.responseText,
              parser = new DOMParser(),
              doc = parser.parseFromString(data,'text/html'),
              ajaxContent = doc.querySelector('#ajax--content > .content');

              //history trick
              history.pushState('','',url);

              //load title
              document.title = doc.title;

              //load content
              document.querySelector('#ajax--content').innerHTML = '';
              document.querySelector('#ajax--content').appendChild(ajaxContent);

              //reload necessary scripts
              var newContent = document.querySelector('#ajax--content');
              var sliderArr = newContent.querySelectorAll('.module--slider');
              if( sliderArr ){
                sliders(sliderArr);
              }

              var elMason = newContent.querySelector('.grid');
              if( sliderArr ){
                masonry(elMason);
              }

              var links = newContent.querySelectorAll('a');
              var buttons = newContent.querySelectorAll('button');
              hovers(links);
              hovers(buttons);

              var newContent = newContent.querySelector('.main');
							var backToTop = newContent.querySelector('.js--back_top');

							backTop(backToTop,newContent);

      }else{
        window.location.href = '/404';
      }
    };

    request.onerror = function(evt) {
      //error messages if there is any
    };

    request.addEventListener('load',introAnim());
    request.send();
  };

  var outroAnim = function(url){
    if( body.classList.contains('enable--mobile_nav') ){
    	body.classList.remove('enable--mobile_nav');
    }
    body.classList.add('is--outro');
    ajaxRequest(url);
  };

  var ajaxClick = function(url){
    outroAnim(url);
  };

  var getAllLinks = function(){
    ajaxLinks = document.querySelectorAll('a');
    ajaxLinks.forEach(function(link,i){
      link.addEventListener('click',function(evt){
        evt.preventDefault();
        ajaxClick(link.href);
      });
    });
  };
  getAllLinks();

  var hamburger = document.querySelector('.hamburger');
  hamburger.addEventListener('click',function(){
  	if( body.classList.contains('enable--mobile_nav') ){
  		body.classList.remove('enable--mobile_nav');
  	}else{
  		body.classList.add('enable--mobile_nav');
  	}
  });


})(jQuery); // Fully reference jQuery after this point.
